import React from 'react';
import { Datagrid, TextField, List, EditButton, DateField } from 'react-admin';
import DeleteButtonWithConfirmation from '../deleteButtonWithConfirmation';
import AddPicButton from '../addPicButton';
export const PostList = props => (
  <List
    bulkActionButtons={false}
    sort={{ field: 'data', order: 'DESC' }}
    {...props}
  >
    <Datagrid>
      <TextField source="titulo" />
      <TextField source="descricao" />
      <DateField locales="pt-BR" source="data" />
      <AddPicButton {...props}></AddPicButton>
      <EditButton label="Gerenciar dados" />
      <DeleteButtonWithConfirmation label="Remover postagem" undoable={true} />
    </Datagrid>
  </List>
);

export default PostList;
